import styled from '@emotion/styled';
import { Container } from '@mui/material';
import React from 'react';
import Sample from './Assests/AssestPhotoSample.jpg'

import '@fontsource/inter/300.css';
import '@fontsource/inter/400.css';
import '@fontsource/inter/500.css';
import '@fontsource/inter/700.css';

// Styled
const AssestBlock = styled('div')(() => ({
  display: "flex",
  width: 250
}))

const AssestPhoto = styled('div')(({ theme }) => ({
  display: "block",
  backgroundColor: "red",
  width: '100%',
  height: 250,
  borderRadius: '10px'
}))

// Components
function Assest(Props) {
  <AssestBlock>
    <AssestPhoto >
      {/* <img src={Props.name} alt="sample" /> */}
    </AssestPhoto>
  </AssestBlock>
}

function App() {
  return (
    <Container fixed>
      <h3>Explore</h3>
      <Assest name = {Sample}/>
      <Assest name = {Sample}/>
    </Container>
  );
}

export default App;
